import { Box,Link, Container, Typography,Paper } from '@mui/material';
import logo from './atoms/images/logo.png';
import React from 'react';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles(theme => ({
    logo:{
        height: '24px',
        width: '99.09677124023438px',
    },
    quote:{
    fontSize: '24px',
    fontStyle: 'normal',
    lineHeight: '32px',
    textAlign: 'left',
    },

}));
function Footer() {
    const classes= useStyles();
    return (
        <div style={{backgroundColor:"#F1F6F4"}}>
            <Box width={378} height={64} marginLeft={20} paddingTop={3} style={{backgroundColor:'#F1F6F4'}}>
            <img src={logo} alt="logo" className={classes.logo} /><br></br>
            <Link style={{fontSize: '24px',fontStyle: 'normal',
    lineHeight: '32px',textAlign: 'left',fontWeight: '500',color:'#0365F2',}} 
    variant='subtitle1'>Big ideas in small packages <br></br>
            Start learnign now
            </Link>
            </Box>

            <Box width={214} height={24} marginRight={5} paddingTop={3} >
            <Link>Editorial</Link>
            <Link> Book Lists</Link>
            </Box>

        </div>
    );
}

export default Footer;
